import Movie from "./Movie";

const MovieList = ({movies, addReview}) => {

    return (
            <div className="movies-list">
                {
                    movies.map((movie, index) => {
                        return (
                            <Movie key={index} movie={movie} addReview={addReview} />
                        )
                    })
                }
            </div>
    )
}

export default MovieList;
